messages.content:
@targon・4 valis please pull and update.
alrighty so;
why have the weights been so wild? digging into the vali logs and monitoring everything, now that miners are splitting their systems behind multiple keys, this is causing a compounding effect of issues. 
1) there is not an infinite amount of traffic ( not really possible, more less) so miners are just getting more and more keys to try and get organics sent to them since everyone can effectively set max qps. need to think how to solve this properly, have a few ideas but tbd
2) We started sharing our verifier nodes with some validators for r1/v3. This seems to have slowed down the speed at which each vali can validate an organic to a sluggish 30~ seconds. This combined with multi-uid causes each vali to only be able to score a few requests per miner per model. solution? We need to scale up our verifier endpoints and increase that throughput. Very confident that will make everything a lot more stable
3) When ctx bonus is combined with the top two, it causes the roulette game; where its just who gets lucky getting a large ctx request scored causing your base to be so much higher than everyone else. Temporarily removed this to help with vtrust and stop the roulette game a bit while we work on spinning up more verification nodes

If there is a tie for
    /// the lowest pruning score, the immune neuron registered earliest is pruned.
    /// Ties for earliest registration are broken by the neuron with the lowest uid.

```
@app.post("/verify")
async def verify_wrapper(request: VerificationRequest) -> Dict:
    res = {}
    start = time.time()
    cached_req = None
    if request.request_id:
        cached_req = cache.get(request.request_id)
    if cached_req:
        print(
            f"Returned cached request {request.request_id} in {time.time() - start}",
            flush=True,
        )
        return cached_req
    try:
        res = await verify(request)
        if request.request_id:
            cache[request.request_id] = res
    except Exception as e:
        print(traceback.format_exc())
        print(e)
    print(f"total time: {time.time() - start}s", flush=True)
    return res
```
